import React, { useState, useEffect, useRef } from "react";
import "./ChatWindow.css";
import { getAIMessage } from "../api/api.js";
import PartCard from "./PartCard.jsx";
import MarkdownRenderer from "./MarkdownRenderer.jsx";
import QuickPromptButtons from "./QuickPromptButtons.jsx";

function ChatWindow() {
  const defaultMessage = [{
    role: "assistant",
    content: "ðŸ›  ðŸ«§ Welcome to PartSelect! I can assist you with your refridgerator or dishwasher.\nI can help you:\n- Find the right parts based on symptoms or part descriptions\n- Provide details on pricing, installation difficulty, and compatibility\n- Guide you to our compatibility checker where you can verify if parts work with your model\n- Share installation videos and repair guidance\n- Assist with brand-specific replacement parts\n\nWhat refrigerator or dishwasher part information can I help you with today?"
  }];

  const [isLoading, setIsLoading] = useState(false);
  const [messages, setMessages] = useState(defaultMessage);
  const [input, setInput] = useState("");
  const inputRef = useRef(null);

  const messagesEndRef = useRef(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const handleSend = async (input) => {
    if (input.trim() !== "") {
      // Set user message
      setMessages(prevMessages => [...prevMessages, { role: "user", content: input }]);
      setInput("");

      setIsLoading(true);

      try {
        // Call API & set assistant message
        const response = await getAIMessage(input);

        // Check if partData is available in the response
        const newMessage = {
          role: "assistant",
          content: response.reply || response.content,
          partData: response.partData || null
        };

        setMessages(prevMessages => [...prevMessages, newMessage]);
      } catch (error) {
        console.error("Error getting AI response:", error);

        // Add error message
        setMessages(prevMessages => [
          ...prevMessages, 
          { 
            role: "assistant", 
            content: "I'm sorry, I encountered an error processing your request. Please try again." 
          }
        ]);
      } finally {
        setIsLoading(false);
      }
    }
  };

  const handleSelectPrompt = (promptTemplate) => {
    setInput(promptTemplate);
    // Focus the input after selecting a prompt
    if (inputRef.current) {
      inputRef.current.focus();

      // Place cursor at the end of the text or at the position where part number should be inserted
      const cursorPosition = promptTemplate.includes('part number') 
        ? promptTemplate.indexOf('part number') + 'part number'.length
        : promptTemplate.length;

      setTimeout(() => {
        inputRef.current.setSelectionRange(cursorPosition, cursorPosition);
      }, 0);
    }
  };

  return (
    <div className="messages-container">
      {messages.map((message, index) => (
        <div key={index} className={`${message.role}-message-container`}>
          {message.content && (
            <div className={`message ${message.role}-message`}>
              {/* Use MarkdownRenderer instead of dangerouslySetInnerHTML */}
              <MarkdownRenderer content={message.content} />

              {/* Render PartCard if partData is available */}
              {message.partData && <PartCard part={message.partData} />}
            </div>
          )}
        </div>
      ))}
      <div ref={messagesEndRef} />

      {isLoading && (
        <div className="assistant-message-container">
          <div className="message assistant-message">
            <div className="typing-indicator">
              <span></span>
              <span></span>
              <span></span>
            </div>
          </div>
        </div>
      )}

      <div className="input-area">
        <div className="input-container">
      <QuickPromptButtons onSelectPrompt={handleSelectPrompt} />
        <div className="input-wrapper">
          <input
            value={input}
            onChange={(e) => setInput(e.target.value)}
            placeholder="Ask me about refrigerator or dishwasher parts..."
            onKeyPress={(e) => {
              if (e.key === "Enter" && !e.shiftKey) {
                handleSend(input);
                e.preventDefault();
              }
            }}
            rows="3"
          />
          <button className="send-button" onClick={() => handleSend(input)}>
            <svg 
              xmlns="http://www.w3.org/2000/svg" 
              width="24" 
              height="24" 
              fill="none" 
              stroke="orange" 
              strokeWidth="2" 
              strokeLinecap="round" 
              strokeLinejoin="round" 
              className="feather feather-send"
            >
              <line x1="22" y1="2" x2="11" y2="13"></line>
              <polygon points="22 2 15 22 11 13 2 9 22 2"></polygon>
            </svg>
          </button>
        </div>
        </div>
      </div>
    </div>
  );
}

export default ChatWindow;
